The European Commission has adopted a proposal to introduce a single market for all goods and services in the EU, with a view to creating a single market for all goods and services in the EU.

The Commission is seeking the opinion of the European Parliament on the proposed single market, and the European Council is expected to adopt a proposal to adopt it by the end of 2016.

The Commission's proposal to introduce a single market for all goods and services in the EU includes:

a single price for goods and services;

a single price for services;

a single tax in the form of an automatic rate on turnover of goods and services for all goods and services;

a single pricing system for all goods and services, which would be based on the price of the product;

a single price for services;

a single price for goods and services for employees;

a single price for goods and services for consumers;

a single price for goods and services for the public service;

a single price for goods and services for the public sector;

a single price for goods and services for the public sector and for public undertakings;

a single price for all goods and services for goods and services for the public sector and for public undertakings.

